	void LoginHandler::waitForFinishConfig(int sock)
	{
		try
		{
			auto packet = Network::receivePacket(sock, -1);
			if (!packet.empty())
			{
				size_t pos = 0;
				int32_t packetId = Protocol::readVarInt(packet, pos);
				if (packetId == 0x03)
					return;
			}
		}
		catch (...)
		{
		}
	}

